class MainApp(QtWidgets.QMainWindow):
    def __init__(self):
        super(MainApp, self).__init__()
        self.ui = Ui_window()  # Create an instance of the generated UI class
        self.ui.setupUi(self)  # Set up the UI on this QMainWindow instance

        # Example: Connect the "Continue" button to a custom function
        self.ui.pushButton.clicked.connect(self.on_continue_clicked)

    def on_continue_clicked(self):
        # This method is part of the class, so `self` is valid here
        print("Continue button clicked!")
        self.ui.tabWidget.setCurrentIndex(1)  # Switch to the second tab
        self.ui.pushButton_2.clicked.connect(self.create_account)
    def create_account(self):
        username = self.ui.lineEdit.text()  # Get the username from the input field
        password = self.ui.lineEdit_2.text()  # Get the password from the input field
        print(f"Account created with username: {username} and password: {password}")
        self.ui.pushButton_3.clicked.connect(self.sign_in)

    def sign_in(self):
        username = self.ui.lineEdit_3.text()
        password = self.ui.lineEdit_4.text()
        if username == "admin" and password == "password":  # Example logic
             print("Sign in successful!")
             self.ui.tabWidget.setCurrentIndex(2)  # Switch to the third tab
        else:
             print("Invalid username or password!")
